  const [heroCount, setHeroCount] = useState(1);
  const [playStatus, setPlayStatus] = useState(false);

  return (
    <div>
    <Background playStatus={playStatus} heroCount={heroCount} />,
    <Navbar/>
    <Hero/>
    </div>
  );
};

export default App;
